static void
thrift_rpc_if_interface_init (ThriftRpcIfInterface *iface)
{
  iface->find_closest_peers = thrift_rpc_client_find_closest_peers;
  iface->find_key = thrift_rpc_client_find_key;
  iface->get_bucket_keys = thrift_rpc_client_get_bucket_keys;
  iface->put = thrift_rpc_client_put;
  iface->put_latest = thrift_rpc_client_put_latest;
  iface->add = thrift_rpc_client_add;
  iface->get = thrift_rpc_client_get;
  iface->get_latest_max = thrift_rpc_client_get_latest_max;
  iface->get_range = thrift_rpc_client_get_range;
}

static void
thrift_rpc_client_init (ThriftRpcClient *client)
{
  client->input_protocol = NULL;
  client->output_protocol = NULL;
}

static void
thrift_rpc_client_class_init (ThriftRpcClientClass *cls)
{
  GObjectClass *gobject_class = G_OBJECT_CLASS (cls);
  GParamSpec *param_spec;

  gobject_class->set_property = thrift_rpc_client_set_property;
  gobject_class->get_property = thrift_rpc_client_get_property;

  param_spec = g_param_spec_object ("input_protocol",
                                    "input protocol (construct)",
                                    "Set the client input protocol",
                                    THRIFT_TYPE_PROTOCOL,
                                    G_PARAM_READWRITE);
  g_object_class_install_property (gobject_class,
                                   PROP_THRIFT_RPC_CLIENT_INPUT_PROTOCOL, param_spec);

  param_spec = g_param_spec_object ("output_protocol",
                                    "output protocol (construct)",
                                    "Set the client output protocol",
                                    THRIFT_TYPE_PROTOCOL,
                                    G_PARAM_READWRITE);
  g_object_class_install_property (gobject_class,
                                   PROP_THRIFT_RPC_CLIENT_OUTPUT_PROTOCOL, param_spec);
}

